#
# Structure for table "tx_wx_order"
#

CREATE TABLE `tx_wx_order` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `wx_user_id` int(11) DEFAULT NULL COMMENT '微信用户id',
  `money` bigint(20) DEFAULT '0' COMMENT '订单金额',
  `create_time` datetime DEFAULT NULL COMMENT '订单时间',
  `order_code` varchar(255) DEFAULT NULL COMMENT '订单号',
  `acc_no` varchar(255) DEFAULT NULL COMMENT '银行卡号',
  `state` int(11) DEFAULT '0' COMMENT '支付状态 0 未支付 1 已支付',
  `style` int(11) DEFAULT '1' COMMENT '订单类型 1 开卡 2 支付',
  `queryId` varchar(255) DEFAULT NULL COMMENT '消费银行交易流水',
  `xf_settleDate` varchar(255) DEFAULT NULL COMMENT '消费清算日期',
  `xf_flg` varchar(255) DEFAULT NULL COMMENT '消费标记',
  `xf_state` int(11) DEFAULT '0' COMMENT '消费状态 0 未消费 1 已消费',
  `df_state` int(11) DEFAULT '0' COMMENT '代付状态 0 未代付 1 已代付',
  `counterFee` int(11) DEFAULT NULL COMMENT '手续费',
  `df_flg` varchar(255) DEFAULT NULL COMMENT '代付标记',
  `df_settleDate` varchar(255) DEFAULT NULL COMMENT '代付清算日',
  `traceNo` varchar(255) DEFAULT NULL COMMENT '系统跟踪号',
  `dfQueryId` varchar(255) DEFAULT NULL COMMENT '代付流水单号',
  `orderAmt` int(11) DEFAULT NULL COMMENT '代付金额',
  `txnTime` varchar(255) DEFAULT NULL COMMENT '订单时间',
  `promoterId` int(11) DEFAULT NULL COMMENT '业务员id',
  `wxUserName` varchar(255) DEFAULT NULL COMMENT '用户姓名',
  `twoPromoterId` int(11) DEFAULT NULL COMMENT '二级业务员id',
  `one_rate` bigint(11) DEFAULT NULL COMMENT '一级分润金额',
  `two_rate` bigint(20) DEFAULT NULL COMMENT '二级分润金额',
  `dev_rate` bigint(20) DEFAULT NULL COMMENT '开发分润金额',
  `msg` varchar(500) DEFAULT NULL COMMENT '失败原因',
  `msgDf` varchar(500) DEFAULT NULL COMMENT '代付回调异常信息',
  PRIMARY KEY (`id`),
  KEY `wx_user_id` (`wx_user_id`),
  KEY `order_code` (`order_code`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8 COMMENT='订单表';

