  `msg` varchar(255) DEFAULT NULL COMMENT '接口验证失败原因',
  `two_promoter_id` int(11) DEFAULT NULL COMMENT '二级拓展业务员',
  PRIMARY KEY (`id`),
  UNIQUE KEY `openId` (`openId`),
  KEY `promoter_id` (`promoter_id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COMMENT='用户表（购买商品用户）';

